import React from 'react';
import styled from 'styled-components';

const Headers:React.FC = () =>{
    return(
        <HeaderWrap>
            <HeaderContainer>
                header
            </HeaderContainer>
        </HeaderWrap>
    );
}

const HeaderWrap = styled.div`
    background-color:#33FF99;
    padding:20px 0px;
`;

const HeaderContainer = styled.div`
    border:1px solid;
    width:1000px;
    margin:0 auto;
`;
export default Headers;
